            "conditions": {
                "channel": {
                    "operator": "in",
                    "value": [
                        "web"
                    ]
                },
                "acr": {
                    "operator": "in",
                    "value": [
                        "urn:iam:acr:aal:pwdsecuritykey"
                    ]
                }
            },
            "result": {
                "effect": "allow",
                "reAuthenticate": "false",
                "obligations": [
                    "PASSWORD:1",
                    "FIDO:2",
                    "SECURITYKEY:2"
                ],
                "msg": "This policy is for pwd+fido+securitykey"
            }
