            "conditions": {
                "channel": {
                    "operator": "in",
                    "value": [
                        "web"
                    ]
                },
                "acr": {
                    "operator": "in",
                    "value": [
                        "urn:iam:acr:aal:any"
                    ]
                }
            },
            "result": {
                "effect": "allow",
                "reAuthenticate": "false",
                "obligations": [
                    "FIDO:1",
                    "SECURITYKEY:1",
                    "SMSOTP:1",
                    "EMAILOTP:1",
                    "MOBILEOTP:1",
                    "PUSH:1"
                ],
                "msg": "This policy is for any of all available authentication methods"
            }
        },
        {
            "conditions": {
                "channel": {
                    "operator": "in",
                    "value": [
                        "web"
                    ]
                },
                "acr": {
                    "operator": "in",
                    "value": [
                        "urn:iam:acr:aal:all"
                    ]
                }
            },
            "result": {
                "effect": "allow",
                "reAuthenticate": "false",
